import Home from "./views/dj/Home/Home";
import Register from "./views/Register.jsx";
import Logins from "./views/Login.jsx";
import Forget from "./views/Forget.jsx";
import Dashboard from "./views/agent/Dashboard.jsx";
import Landing from "./views/agent/Landing.jsx";

var routes = [
    { path: "/", name: window.location.pathname, component: Home, layout: "/" },
    
    { path: "/login", icon: "fa fa-home", name: "Login", component: Logins, layout: "/auth" },
    { path: "/register", icon: "fa fa-home", name: "Register", component: Register, layout: "/auth" },
    { path: "/Forget", icon: "fa fa-home", name: "Forget", component: Forget, layout: "/auth" },
    { path: "/Dashboard", icon: "fa fa-home", name: "Dashboard", component: Dashboard, layout: "/auth" },
    { path: "/Landing", icon: "fa fa-home", name: "Landing", component: Landing, layout: "/agent" },
    
];
export default routes;
